import { Fragment, FunctionComponent } from "react";
import ReactPlayer from 'react-player';
import CurrentTime from "../Components/Molecules/currentTime";
import Slip_voet from "../Assets/Images/slip_voet.png";

const Products: FunctionComponent = () => {
    return (
        <Fragment>
            <div className="page-container">
                <div className="video-section">
                    <div className="video-container">
                        <div className="supportStockings" >

                            <ReactPlayer width='100%' height='60' border-radius= '0.25rem' url="https://www.youtube.com/watch?v=jfzmtlx3FMQ" />
                        </div>
                    </div>
                    <div className="video-container">
                        <div className="Easyslide-Magnide">
                            <ReactPlayer width='100%' height='60' border-radius= '0.25rem'  url="https://www.youtube.com/watch?v=2sWaVV5Sb2I" />
                        </div>
                    </div>
                    <div className="Slip_voet">

                        <img src={Slip_voet} />

                    </div>

                    <div className="map">
                        <img src="" alt="" />
                    </div>
                </div>

            </div>
        </Fragment>
    );
}

export default Products;
